import { BrowserRouter, Routes, Route } from "react-router-dom";
import AuthProvider from "./context/productContext";
import DashboardContainer from "./containers/ProductContainer";

function App() {
  return (
    <AuthProvider>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<DashboardContainer />} />
        </Routes>
      </BrowserRouter>
    </AuthProvider>
  );
}

export default App;
